As mentioned, the state layer is responsible for holding and managing the data. It exposes ways for the Connection and Agent layers to set and get values to and from the state. When implementing a State layer, one must conform to the State trait. /// The State trait.
///
/// Every state implementor must implement this trait. It is first auto-loaded by the configuration
/// deserializer and then initialized by the library by calling the `init` function. The `init`
/// function should return a [SafeState] which is then passed to the connection and agent layers.
#[typetag::serde(tag = "kind")]
pub trait State: std::fmt::Debug + Send + Sync + CloneState { /// Initializes the state and returns a state that is safe to be shared across threads. /// /// A state object is already loaded by the configuration. The implementor can use this /// function to add or initialize any other relevant data and then return a SafeState object /// which is shared with the connection and agent layers. fn init(&self) -> SafeState; /// Returns the version of the current state. /// /// An implementor can use this function to keep a version for each "state" of the sate. For /// example, the default state implementation sets this value to /// a random string whenever the state changes. It is then saves that version in a version history which /// allows for the connection layer to compute diff between two versions. fn version(&self) -> String; /// Sets a value to the state. /// /// There's no assumption about the value itself. It can be anything the implementor wishes. /// The default state implementation, for example, treats this value as a map of key/value /// pairs where the key is a String and the value conforms to a serde_json::Value value. fn set(&self, value: &dyn StateValue) -> Result<(), Box<dyn StdError>>; /// Gets the value associated with the specified key. /// /// To allow maximum flexibility, the key itself is a StateValue, which in effect means it can /// be anything desired by the implementor. fn get(&self, key: &dyn StateValue) -> Option<Box<dyn StateValue>>; /// Returns the value associated with the specified key or the default if the key was not found /// in the state. fn get_or(&self, key: &dyn StateValue, default: Box<dyn StateValue>) -> Box<dyn StateValue> { self.get(key).unwrap_or(default) } /// Returns the difference between this and the `other` state. fn diff(&self, other: &dyn StateValue) -> Result<Box<dyn StateValue>, Box<dyn StdError>>; /// Returns the whole state as a StateValue. /// /// This is helpful when the connection layer wishes to publish the whole state to its peers. fn get_root(&self) -> Option<Box<dyn StateValue>>;
} As you can see from the code snippet of the State trait, a few functions must be implemented. init - When the state layer is first being loaded by the framework, the init function is called and is expected to return a SafeState instance of the state. A SafeState is just a typedef to the state wrapped in an Arc so it can be safely shared between the different layers. It is up to the implementation to make sure the state is thread-safe. The Default state layer implementation uses this function to initialize a few background threads. version - The version function can be used by a Connection layer to optimize exchanging states with other peers. The Default connection layer implementation does not publish a state that has already been published before. It also uses it when retrieving a state from other peers by specifying the version it has. The Default state layer calculates the version by hashing the keys and timestamps for each key. Each implementation should choose what's best for its use case. Imagine a Git state layer where the version is the HEAD. set - This is the function used by the other layers to set values into the state. You can see that it accepts a StateValue. You will learn more about the StateValue later on in this chapter, but for now it's important to note that the StateValue can represent any data structure. The connection and agent layers do not know anything about the value. They just pass a vector of bytes to the state and it's up to the state to deserialize it to the proper data structure. The Default state assumes the StateValue is a JSON object with a key and a value that contains different fields (ttl, ts and the value itself). get - This function is called by the other layers to get a value from the state. Same as the set function, it accepts a StateValue that should represent something that the state knows how to deal with. The Default state assumes this is a string that represents the key to be retrieved. get_or - Is a convenience function that allows to specify a default value if the key being retrieved does not exist. diff - This function should calculate the diff between this state and the state that is specified as a parameter. The Default connection layer calls this function when it wants to publish the changes since last publish time. get_root - This function is called by other layers when they need the whole state. The Default connection layer uses it to get the full state to be exchanged with other peers.

