The behavior of the Default agent is straight forward. It runs a HTTP server with two handlers for getting and setting values. async fn handler(state: state::SafeState, req: Request<Body>) -> Result<Response<Body>> { Ok(match req.method() { &Method::GET => get_handler(state, &req), &Method::PUT => set_handler(state, req).await.unwrap(), _ => Responses::not_found(None), })
} impl Default { async fn server(&self, state: state::SafeState) -> Result<()> { let service = make_service_fn(move |_| { let state = state.clone(); async move { Ok::<_, Box<dyn StdError + Send + Sync>>(service_fn(move |req| { handler(state.clone(), req) })) } }); let server = Server::try_bind(&([0, 0, 0, 0], self.port).into())?; server.serve(service).await?; Ok(()) }
}

