) -> impl FutureExt<Output = Result<Response<Body>>> + 'a { hyper::body::to_bytes(req.into_body()) .and_then(move |body| async move { let body = &body as &dyn state::StateValue; let result = state.set(body); Ok(match result { Ok(_) => Responses::no_content(), _ => Responses::unprocessable(None), }) }) .map_err(|e| e.into())
} The Default connection layer exposes this function to allow other peers to publish their state. It will accept the state and set it to the State layer.

